INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス", 24, 0.0, 1, 7, 100, "2024/03/31 12:00:00", "エリコ", 100, 0.0, 10.85, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス", 24, 0.0, 1, 2, 101, "2024/03/31 12:00:00", "エリコ", 101, 0.0, 11.15, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…", 24, 0.0, 7, 5, 102, "2024/03/31 12:00:00", "エリコ", 102, 0.0, 6.4, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？", 24, 0.0, 3, 3, 103, "2024/03/31 12:00:00", "エリコ", 103, 0.0, 0.0, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス", 24, 0.0, 2, 8, 104, "2024/03/31 12:00:00", "エリコ", 104, 0.0, 2.43, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？", 24, 0.0, 4, 3, 105, "2024/03/31 12:00:00", "エリコ", 105, 0.0, 9.08, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので", 24, 0.0, 6, 6, 106, "2024/03/31 12:00:00", "エリコ", 106, 0.0, 0.0, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス", 24, 0.0, 3, 8, 107, "2024/03/31 12:00:00", "エリコ", 107, 0.0, 10.6, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね", 24, 0.0, 6, 4, 108, "2024/03/31 12:00:00", "エリコ", 108, 0.0, 7.54, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…", 24, 0.0, 2, 7, 109, "2024/03/31 12:00:00", "エリコ", 109, 0.0, 11.5, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう", 24, 0.0, 2, 1, 110, "2024/03/31 12:00:00", "エリコ", 110, 0.0, 8.83, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね", 24, 0.0, 1, 2, 111, "2024/03/31 12:00:00", "エリコ", 111, 0.0, 6.68, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい", 24, 0.0, 6, 2, 112, "2024/03/31 12:00:00", "エリコ", 112, 0.0, 8.8, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから", 24, 0.0, 2, 1, 113, "2024/03/31 12:00:00", "エリコ", 113, 0.0, 8.9, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！", 24, 0.0, 2, 5, 114, "2024/03/31 12:00:00", "エリコ", 114, 0.0, 3.7, 129901);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ", 24, 0.0, 1, 2, 200, "2024/03/31 12:00:00", "マコト", 200, 0.0, 7.6, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ", 24, 0.0, 2, 1, 201, "2024/03/31 12:00:00", "マコト", 201, 0.0, 2.25, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ", 24, 0.0, 2, 1, 202, "2024/03/31 12:00:00", "マコト", 202, 0.0, 3.28, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！", 24, 0.0, 4, 1, 203, "2024/03/31 12:00:00", "マコト", 203, 0.0, 2.98, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！", 24, 0.0, 4, 1, 204, "2024/03/31 12:00:00", "マコト", 204, 0.0, 3.0, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！", 24, 0.0, 1, 2, 205, "2024/03/31 12:00:00", "マコト", 205, 0.0, 10.3, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！", 24, 0.0, 6, 1, 206, "2024/03/31 12:00:00", "マコト", 206, 0.0, 2.93, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！", 24, 0.0, 3, 1, 207, "2024/03/31 12:00:00", "マコト", 207, 0.0, 9.3, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ", 24, 0.0, 4, 1, 208, "2024/03/31 12:00:00", "マコト", 208, 0.0, 6.9, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！", 24, 0.0, 2, 2, 209, "2024/03/31 12:00:00", "マコト", 209, 0.0, 0.0, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ", 24, 0.0, 1, 2, 210, "2024/03/31 12:00:00", "マコト", 210, 0.0, 5.95, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…", 24, 0.0, 2, 1, 211, "2024/03/31 12:00:00", "マコト", 211, 0.0, 6.73, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！", 24, 0.0, 2, 2, 212, "2024/03/31 12:00:00", "マコト", 212, 0.0, 0.0, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ", 24, 0.0, 1, 2, 213, "2024/03/31 12:00:00", "マコト", 213, 0.0, 6.65, 129801);
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 10142, "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！", 24, 0.0, 6, 1, 214, "2024/03/31 12:00:00", "マコト", 214, 0.0, 3.05, 129801);
